import { useNavigate } from "react-router-dom";

export default function Button({ text, href }) {  
  const navigate = useNavigate();

  function handleClick() {
    navigate(href);
  }

  return (
    <button className="btn" onClick={handleClick}>
      {text}
    </button>  
  );
}
